import{_ as t,c as a,o as s,ag as o}from"./chunks/framework.Ds6Eueu6.js";const u=JSON.parse('{"title":"FETCH","description":"","frontmatter":{},"headers":[],"relativePath":"docs/7x/ref_guide/sql_commands/FETCH.md","filePath":"docs/7x/ref_guide/sql_commands/FETCH.md"}'),n={name:"docs/7x/ref_guide/sql_commands/FETCH.md"};function i(r,e,c,p,d,l){return s(),a("div",null,e[0]||(e[0]=[o(`<h1 id="fetch" tabindex="-1">FETCH <a class="header-anchor" href="#fetch" aria-label="Permalink to &quot;FETCH&quot;">​</a></h1><p>Retrieves rows from a query using a cursor.</p><h2 id="synopsis" tabindex="-1"><a id="section2"></a>Synopsis <a class="header-anchor" href="#synopsis" aria-label="Permalink to &quot;&lt;a id=&quot;section2&quot;&gt;&lt;/a&gt;Synopsis&quot;">​</a></h2><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>FETCH [ &lt;forward_direction&gt; { FROM | IN } ] &lt;cursor_name&gt;</span></span></code></pre></div><p>where &lt;forward_direction&gt; can be empty or one of:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>    NEXT</span></span>
<span class="line"><span>    FIRST</span></span>
<span class="line"><span>    ABSOLUTE &lt;count&gt;</span></span>
<span class="line"><span>    RELATIVE &lt;count&gt;</span></span>
<span class="line"><span>    &lt;count&gt;</span></span>
<span class="line"><span>    ALL</span></span>
<span class="line"><span>    FORWARD</span></span>
<span class="line"><span>    FORWARD &lt;count&gt;</span></span>
<span class="line"><span>    FORWARD ALL</span></span></code></pre></div><h2 id="description" tabindex="-1"><a id="section3"></a>Description <a class="header-anchor" href="#description" aria-label="Permalink to &quot;&lt;a id=&quot;section3&quot;&gt;&lt;/a&gt;Description&quot;">​</a></h2><p><code>FETCH</code> retrieves rows using a previously-created cursor.</p><blockquote><p><strong>Note</strong> You cannot <code>FETCH</code> from a <code>PARALLEL RETRIEVE CURSOR</code>, you must <a href="./RETRIEVE.html">RETRIEVE</a> the rows from it.</p></blockquote><p>A cursor has an associated position, which is used by <code>FETCH</code>. The cursor position can be before the first row of the query result, on any particular row of the result, or after the last row of the result. When created, a cursor is positioned before the first row. After fetching some rows, the cursor is positioned on the row most recently retrieved. If <code>FETCH</code> runs off the end of the available rows then the cursor is left positioned after the last row. <code>FETCH ALL</code> will always leave the cursor positioned after the last row.</p><blockquote><p><strong>Note</strong> Because WarehousePG does not support scrollable cursors, it is not possible to move a cursor position backwards. You can only move a cursor forward in position using <code>FETCH</code>.</p></blockquote><p>The forms <code>NEXT</code>, <code>FIRST</code>, <code>ABSOLUTE</code>, <code>RELATIVE</code> fetch a single row after moving the cursor appropriately. If there is no such row, an empty result is returned, and the cursor is left positioned before the first row or after the last row as appropriate.</p><p>The forms using <code>FORWARD</code> retrieve the indicated number of rows moving in the forward direction, leaving the cursor positioned on the last-returned row (or after all rows, if the count exceeds the number of rows available).</p><p><code>RELATIVE 0</code> and <code>FORWARD 0</code> request fetching the current row without moving the cursor, that is, re-fetching the most recently fetched row. This will succeed unless the cursor is positioned before the first row or after the last row, in which case no row is returned.</p><blockquote><p><strong>Note</strong> This page describes usage of cursors at the SQL command level. If you are trying to use cursors inside a PL/pgSQL function, the rules are different. See <a href="./../../analytics/pl_sql.html#topic1">PL/pgSQL function</a>.</p></blockquote><h2 id="parameters" tabindex="-1"><a id="section5"></a>Parameters <a class="header-anchor" href="#parameters" aria-label="Permalink to &quot;&lt;a id=&quot;section5&quot;&gt;&lt;/a&gt;Parameters&quot;">​</a></h2><p>forward_direction : Defines the fetch direction and number of rows to fetch. Only forward fetches are allowed in WarehousePG. It can be one of the following:</p><p>NEXT : Fetch the next row. This is the default if direction is omitted.</p><p>FIRST : Fetch the first row of the query (same as <code>ABSOLUTE 1</code>). Only allowed if it is the first <code>FETCH</code> operation using this cursor.</p><p>ABSOLUTE count : Fetch the specified row of the query. Position after last row if count is out of range. Only allowed if the row specified by count moves the cursor position forward.</p><p>RELATIVE count : Fetch the specified row of the query count rows ahead of the current cursor position. <code>RELATIVE 0</code> re-fetches the current row, if any. Only allowed if count moves the cursor position forward.</p><p>count : Fetch the next count number of rows (same as <code>FORWARD count</code>).</p><p>ALL : Fetch all remaining rows (same as <code>FORWARD ALL</code>).</p><p>FORWARD : Fetch the next row (same as <code>NEXT</code>).</p><p>FORWARD count : Fetch the next count number of rows. <code>FORWARD 0</code> re-fetches the current row.</p><p>FORWARD ALL : Fetch all remaining rows.</p><p>cursor_name : The name of an open cursor.</p><h2 id="outputs" tabindex="-1"><a id="section5a"></a>Outputs <a class="header-anchor" href="#outputs" aria-label="Permalink to &quot;&lt;a id=&quot;section5a&quot;&gt;&lt;/a&gt;Outputs&quot;">​</a></h2><p>On successful completion, a <code>FETCH</code> command returns a command tag of the form</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>FETCH &lt;count&gt;</span></span></code></pre></div><p>The count is the number of rows fetched (possibly zero). Note that in <code>psql</code>, the command tag will not actually be displayed, since <code>psql</code> displays the fetched rows instead.</p><h2 id="notes" tabindex="-1"><a id="section6"></a>Notes <a class="header-anchor" href="#notes" aria-label="Permalink to &quot;&lt;a id=&quot;section6&quot;&gt;&lt;/a&gt;Notes&quot;">​</a></h2><p>WarehousePG does not support scrollable cursors, so you can only use <code>FETCH</code> to move the cursor position forward.</p><p><code>ABSOLUTE</code> fetches are not any faster than navigating to the desired row with a relative move: the underlying implementation must traverse all the intermediate rows anyway.</p><p><code>DECLARE</code> is used to define a cursor. Use <code>MOVE</code> to change cursor position without retrieving data.</p><h2 id="examples" tabindex="-1"><a id="section7"></a>Examples <a class="header-anchor" href="#examples" aria-label="Permalink to &quot;&lt;a id=&quot;section7&quot;&gt;&lt;/a&gt;Examples&quot;">​</a></h2><p>Start the transaction:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>BEGIN;</span></span></code></pre></div><p>Set up a cursor:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>DECLARE mycursor CURSOR FOR SELECT * FROM films;</span></span></code></pre></div><p>Fetch the first 5 rows in the cursor <code>mycursor</code>:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>FETCH FORWARD 5 FROM mycursor;</span></span>
<span class="line"><span> code  |          title          | did | date_prod  |   kind   |  len</span></span>
<span class="line"><span>-------+-------------------------+-----+------------+----------+-------</span></span>
<span class="line"><span> BL101 | The Third Man           | 101 | 1949-12-23 | Drama    | 01:44</span></span>
<span class="line"><span> BL102 | The African Queen       | 101 | 1951-08-11 | Romantic | 01:43</span></span>
<span class="line"><span> JL201 | Une Femme est une Femme | 102 | 1961-03-12 | Romantic | 01:25</span></span>
<span class="line"><span> P_301 | Vertigo                 | 103 | 1958-11-14 | Action   | 02:08</span></span>
<span class="line"><span> P_302 | Becket                  | 103 | 1964-02-03 | Drama    | 02:28</span></span></code></pre></div><p>Close the cursor and end the transaction:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>CLOSE mycursor;</span></span>
<span class="line"><span>COMMIT;</span></span></code></pre></div><p>Change the <code>kind</code> column of the table <code>films</code> in the row at the <code>c_films</code> cursor&#39;s current position:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>UPDATE films SET kind = &#39;Dramatic&#39; WHERE CURRENT OF c_films;</span></span></code></pre></div><h2 id="compatibility" tabindex="-1"><a id="section8"></a>Compatibility <a class="header-anchor" href="#compatibility" aria-label="Permalink to &quot;&lt;a id=&quot;section8&quot;&gt;&lt;/a&gt;Compatibility&quot;">​</a></h2><p>SQL standard allows cursors only in embedded SQL and in modules. WarehousePG permits cursors to be used interactively.</p><p>The variant of <code>FETCH</code> described here returns the data as if it were a <code>SELECT</code> result rather than placing it in host variables. Other than this point, <code>FETCH</code> is fully upward-compatible with the SQL standard.</p><p>The <code>FETCH</code> forms involving <code>FORWARD</code>, as well as the forms <code>FETCH</code> count and <code>FETCH ALL</code>, in which <code>FORWARD</code> is implicit, are WarehousePG extensions. <code>BACKWARD</code> is not supported.</p><p>The SQL standard allows only <code>FROM</code> preceding the cursor name; the option to use <code>IN</code>, or to leave them out altogether, is an extension.</p><h2 id="see-also" tabindex="-1"><a id="section9"></a>See Also <a class="header-anchor" href="#see-also" aria-label="Permalink to &quot;&lt;a id=&quot;section9&quot;&gt;&lt;/a&gt;See Also&quot;">​</a></h2><p><a href="./DECLARE.html">DECLARE</a>, <a href="./CLOSE.html">CLOSE</a>, <a href="./MOVE.html">MOVE</a></p><p><strong>Parent topic:</strong> <a href="./../sql_commands/sql_ref.html">SQL Commands</a></p>`,54)]))}const m=t(n,[["render",i]]);export{u as __pageData,m as default};
